import React, { useEffect } from 'react'
import { useDispatch } from 'react-redux'
import { closeMenu } from './utils/appSlice';

const Watch = () => {
    const dispatch = useDispatch();

    useEffect(() =>{
        dispatch(closeMenu())
    },[]);
  return (
    <div>
        <iframe width="560" height="315" src="https://www.youtube.com/embed/Bi2A180vAVQ?si=coDVQad84bmo26UI" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>
    </div>
  )
}

export default Watch
